Rust MongoDB findOne not working with $or<p>I'm trying to query a MongoDB collection using an <code>$or</code> query, but for some reason it is not working.</p>
<p>Here is the document I'm trying to query, which is the only document in its collection:</p>
<pre><code>{&quot;_id&quot;:{&quot;$oid&quot;:&quot;64be8e2689e1214e4930d36b&quot;},&quot;initiator&quot;:{&quot;$oid&quot;:&quot;64b42c63e302b112bc7c8dbc&quot;},&quot;target&quot;:{&quot;$oid&quot;:&quot;64ba9f4bef8b64c5b92ecb40&quot;},&quot;status&quot;:&quot;InitiatorRequested&quot;,&quot;timestamp&quot;:{&quot;$date&quot;:{&quot;$numberLong&quot;:&quot;1690209830575&quot;}},&quot;accept_timestamp&quot;:null}
</code></pre>
<p>Here is my original code, <code>user</code> and <code>target</code> are both of type <code>bson::oid::ObjectId</code> (<code>user</code> is the initiator and <code>target</code> is the target, both are indexed):</p>
<pre class="lang-rust prettyprint-override"><code>db.auto_collection::&lt;Friend&gt;().find_one(doc! {
    &quot;$or&quot;: [
        {
            &quot;initiator&quot;: user,
            &quot;target&quot;: target,
        },
        {
            &quot;initiator&quot;: target,
            &quot;target&quot;: user,
        }
    ],
}, None).await?
</code></pre>
<p>This does not return the document, but the code below does:</p>
<pre class="lang-rust prettyprint-override"><code>db.auto_collection::&lt;Friend&gt;().find_one(doc! {
    &quot;$or&quot;: [
        {
            &quot;initiator&quot;: user,
            &quot;target&quot;: target,
        },
    ],
}, None).await?
</code></pre>
<p>Why could this be happening? The second operator shouldn't even apply, yet it kills the entire operation. No error is returned from either query.</p>

