Mongo $sort and then $group, is order guaranteed?<p>I have a bunch of documents representing points scored in a game. I want to group the points by user ID and sum them, with a gotcha: it's possible to score negative points, but the running sum should never go below zero. So for example if user 1 scored the following points in this order:</p>
<pre><code>1
2
-5
3
</code></pre>
<p>Then their final score should be <code>3</code>, because the <code>-5</code> only takes them down to 0 total, rather than <code>-2</code>.</p>
<p>I have this aggregation pipeline which, as far as I can tell, correctly accomplishes this:</p>
<pre class="lang-json prettyprint-override"><code>[
  {
    $sort: {
      earnedDate: 1,
    },
  },
  {
    $group: {
      _id: '$userId',
      pointDeltas: {
        $push: '$points',
      },
      userId: {
        $first: '$userId',
      },
    },
  },
  {
    $project: {
      userId: 1,
      points: {
        $reduce: {
          input: '$pointDeltas',
          initialValue: 0,
          in: {
            $max: [
              0,
              {
                $add: ['$$value', '$$this'],
              },
            ],
          },
        },
      },
    },
  }
]
</code></pre>
<p>This depends on the <code>points</code> being pushed onto <code>pointDeltas</code> in the right order (by <code>earnedDate</code>, ascending).</p>
<p>Experimentally, this does seem to happen. But is this guaranteed?</p>
<p>I noticed the <a href="https://www.mongodb.com/docs/manual/reference/operator/aggregation/group/" rel="nofollow noreferrer">official documentation</a> for the <code>$first</code> operator states:</p>
<blockquote>
<p>Returns a value from the first document for each group. Order is only defined if the documents are sorted.</p>
</blockquote>
<p>This seems like a hint that the documents are processed in order, though it's not 100% clear if this principle applies to using <code>$push</code> too. The documentation for <code>$push</code> on the same page does not have a similar note.</p>
<p>Is this behavior guaranteed or coincidental? I haven't been able to find any bulletproof answer either way.</p>

