MongoDB Compass - Compare array fields within same document<p>Hi I have a document with the structure as shown below:</p>
<pre><code>{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;5bc7a1d14cedfd0006445b10&quot;
  },
  &quot;externalId&quot;: {
    &quot;$numberLong&quot;: &quot;70285&quot;
  },
  &quot;passengers&quot;: [
    {
      &quot;_id&quot;: {
        &quot;$numberLong&quot;: &quot;3757&quot;
      },
      &quot;name&quot;: &quot;abc&quot;,
      &quot;email&quot;: &quot;abc@xyz.com&quot;
    },
    {
      &quot;_id&quot;: {
        &quot;$numberLong&quot;: &quot;398&quot;
      },
      &quot;name&quot;: &quot;abc n&quot;,
      &quot;email&quot;: &quot;abc@xyz.com&quot;
    }
  ]
}
</code></pre>
<p>Here I want to find all the documents where the first element of the passenger email is the same as the second element.</p>
<p>In MongoDB Compass I could use the filter to do like this:</p>
<pre><code>{&quot;passengers.0.email&quot;: &quot;abc@xyz.com&quot;}
</code></pre>
<p>This gives me all the emails where the passenger with the first item has &quot;abc@xyz.com&quot; as email. The same case is if I search for the second element.</p>
<p>But when I try to do the following</p>
<pre><code>{&quot;passengers.0.email&quot;: &quot;passengers.1.email&quot;}
</code></pre>
<p>It does not give me all docs where the first two items in the array have the same email. Is this possible using the MongoDB Compass?</p>

