Getting errors when using useFieldArray in a React-Hook-Form implementation<p>I have a custom MUI Autocomplete component that is utilized on a form using React-Hook-Form useFieldArray function. It produces the following warning:</p>
<pre><code>The value provided to Autocomplete is invalid.
None of the options match with `{&quot;id&quot;:&quot;1&quot;,&quot;name&quot;:&quot;Electrical High Voltage&quot;}`.
You can use the `isOptionEqualToValue` prop to customize the equality test.
</code></pre>
<p>I'm not sure on how to fix this. The component works well on other forms/components, but seems to throw the above warning when used within a useFieldArray function. The component is still functional and loads the correct data.</p>
<p>I'm using MongoDB and am storing my data as such... with my code structures as below...</p>
<pre><code>...
&quot;eiclDetail&quot;: {
...
...
      &quot;checklistDetail&quot;: [
        {
          &quot;code&quot;: {
            &quot;id&quot;: &quot;1&quot;,
            &quot;name&quot;: &quot;Electrical High Voltage&quot;
          },
          ...
          ...
        }
      ],
    },
...
</code></pre>
<p>Custom Component:</p>
<pre><code>import React from &quot;react&quot;;
import { Controller, useFormContext } from &quot;react-hook-form&quot;;

import Box from &quot;@mui/material/Box&quot;;
import Autocomplete from &quot;@mui/material/Autocomplete&quot;;
import TextField from &quot;@mui/material/TextField&quot;;
import Chip from &quot;@mui/material/Chip&quot;;
import DeleteIcon from &quot;@mui/icons-material/Delete&quot;;

export const MUIAutocomplete = ({
  disableClearable,
  disableCloseOnSelect,
  color,
  ...props
}) =&gt; {
  const { control } = useFormContext();

  return (
    &lt;Controller
      name={props.name}
      control={control}
      defaultValue={props.multiple ? [] : null}
      render={({ field: { ref, ...field }, fieldState: { error } }) =&gt; (
        &lt;Autocomplete
          {...field}
          readOnly={props.readOnly}
          disableCloseOnSelect={disableCloseOnSelect ? true : false}
          multiple={props.multiple}
          disableClearable={disableClearable ? true : false}
          options={props.options}
          getOptionLabel={(
            option 
          ) =&gt;
            option?.name === undefined ||
            option?.name === &quot;&quot; ||
            option?.name === [] ||
            option?.name
          }
          renderOption={(props, option) =&gt; {
            return (
              &lt;Box
                component=&quot;li&quot;
                {...props}
                key={option.id}
                color={
                  color
                    ? color.map((value) =&gt;
                        value.id === option.id ? &quot;green&quot; : null
                      )
                    : null
                }
              &gt;
                {option.name}
              &lt;/Box&gt;
            );
          }}
          isOptionEqualToValue={(option, value) =&gt;
            value === undefined || value === &quot;&quot; || option.id === value.id
          }
          onChange={(_, data) =&gt; field.onChange(data)}
          renderInput={(params) =&gt; (
            &lt;TextField
              {...params}
              {...props}
              error={error ? true : false}
              helperText={error ? error.message : &quot;&quot;}
            /&gt;
          )}
          renderTags={(tagValue, getTagProps) =&gt;
            tagValue.map((option, index) =&gt; (
              &lt;div style={{ width: &quot;100%&quot;, mt: 1 }} key={option.id}&gt;
                &lt;Chip
                  {...getTagProps({ index })}
                  label={option.name}
                  key={option.id}
                  variant=&quot;outlined&quot;
                  deleteIcon={&lt;DeleteIcon /&gt;}
                  color=&quot;primary&quot;
                /&gt;
              &lt;/div&gt;
            ))
          }
        /&gt;
      )}
    /&gt;
  );
};
</code></pre>
<p>and my parent component:</p>
<pre><code>import React, { useState, useEffect } from &quot;react&quot;;
import { useStateMachine } from &quot;little-state-machine&quot;;
import { useFieldArray } from &quot;react-hook-form&quot;;

import updateAction from &quot;../../../actions/updateAction&quot;;
import clearAction from &quot;../../../actions/clearAction&quot;;

import Card from &quot;@mui/material/Card&quot;;
import CardHeader from &quot;@mui/material/CardHeader&quot;;
import CardContent from &quot;@mui/material/CardContent&quot;;

import { MUIAutocomplete } from &quot;../../../shared/components/common/MUIAutocomplete&quot;;

const ChecklistItemDetail = () =&gt; {
  const [autocompleteOptions, setAutocompleteOptions] = useState([]);

  const { state } = useStateMachine({
    updateAction,
    clearAction,
  });

  const { fields } = useFieldArray({
    name: &quot;eiclDetail.checklistDetail&quot;,
  });

  useEffect(() =&gt; {
    setAutocompleteOptions([
      { id: 1, name: &quot;Electrical High Voltage&quot; },
      { id: 2, name: &quot;Electrical Low Voltage&quot; },
      { id: 3, name: &quot;Radiation&quot; },
      { id: 4, name: &quot;Mechanical&quot; },
    ]);
  }, []);

  return (
    &lt;&gt;
      &lt;Card&gt;
        &lt;CardHeader /&gt;
        &lt;CardContent&gt;
          {fields.map((item, index) =&gt; {
            return (
              &lt;MUIAutocomplete
                name={`eiclDetail.checklistDetail.${index}.code`}
                label=&quot;Code&quot;
                variant=&quot;outlined&quot;
                size=&quot;small&quot;
                fullWidth
                options={autocompleteOptions}
              /&gt;
            );
          })}
        &lt;/CardContent&gt;
      &lt;/Card&gt;
    &lt;/&gt;
  );
};

export default ChecklistItemDetail;
</code></pre>
<p>I've cut the code down for clarity. Please advise on a potential fix to this issue.
Thanks in advance.</p>

