MongoDB Automatic client side Field level Encryption | mongoCryptD daemon not marking the fields to be encrypted<p>I am using MongoDB's automatic client side field level encryption, But I observed that the fields are not getting encrypted in the collection.</p>
<ul>
<li>The MongoDB-crypt library that I am using is 1.6.1</li>
<li>mongo driver core and sync version are 4.9.1</li>
<li>The MongoCryptD version is 5.0.3</li>
<li>The OS is linux (RHEL 7.9)</li>
<li>MongoDB version 4.2.11 Enterprise edition.</li>
<li>Java JDK- 17</li>
</ul>
<p>The Class that represents my document that I want to perform field encryption on is annotated with @Encrypted annotation with the data key ID and the Encryption algorithm
and also the fields in that class I want to encrypt is simply annotated with @Encypted annotation.</p>
<p>So it looks something like this -&gt;</p>
<pre><code>@Data  // lombok
@Document
@Encrypted (keyID=&quot;&lt;the key id&gt;&quot;, algorithm= &quot;&lt;The algorithm&gt;&quot;)
public class MyDocument{
   @Id
   private UUID dataID;

   @Encrypted
   private String fieldToBeEncrypted;

   private String otherField;
} 

</code></pre>
<p>I am using MongoJsonSchemaCreator's createSchemaFor() method with a filter method MongoJsonSchemaCreator.encryptedOnly() in order to generate a Json Schema after which I then create a SchemaMap from.</p>
<p>this schemaMap I am then populating while creating AutoEncryptionSettings.-&gt;</p>
<pre><code>MongoClientSettings clientSettings = MongoClientSettings.builder()
.autoEncryptionSettings(AutoEncryptionSettings.builder()
        .keyVaultNamespace(keyVaultNamespace)
        .kmsProviders(kmsProviders)
        .schemaMap(schemaMap)
        .extraOptions(extraOptions)
        .build())
...(other settings)
    .build();
</code></pre>
<p>The master key that I am putting in the kmsProviders is a 96 bytes random character that I generate with OpenSSL random command.</p>
<hr />
<p>Now the problem is that I am not seeing any data being encrypted and also I do not see any failure message in the console logs.</p>
<p>Now my question is -&gt;</p>
<ol>
<li>Where does the actual encryption happens ? it is definitly not in the mongocryptd as the docs states so.
So what is actually handling the encryption ?</li>
<li>Is there any settings we have to enable in the mongo cluster in order to enable auto field encryption.</li>
<li>The versions that I have stated at the top of my question are those inter compatible with each other and the linux OS as well ?</li>
<li>Is there any checklist in general that I can use in order to troubleshoot this issue of encryption not happening ?</li>
</ol>
<p>It seems that the mongocryptd process is not marking the fields to be encrypted for writes and thus no encryption is taking place but not sure</p>
<hr />
<p>Edit 1:</p>
<p>Sharing the rough SchemaMap that I tried in my AutoEncryptionSettings but this to has failed -&gt;</p>
<pre><code>schemaMap.put(getDatabaseName() + &quot;.MyDocument&quot;, BsonDocument.parse(&quot;{&quot;
  + &quot;  bsonType: \&quot;object\&quot;,&quot;
  + &quot;  encryptMetadata: {&quot;
  + &quot;    keyId: [UUID(\&quot;&quot; + keyUuid + &quot;\&quot;)]&quot;
  + &quot;  },&quot;
  + &quot;  properties: {&quot;
  + &quot;    fieldToBeEncrypted: {&quot;
  + &quot;      encrypt: {&quot;
  + &quot;        bsonType: \&quot;string\&quot;,&quot;
  + &quot;        algorithm: \&quot;AEAD_AES_256_CBC_HMAC_SHA_512-Deterministic\&quot;&quot;
  + &quot;      }&quot;
  + &quot;    }&quot;
  + &quot;  }&quot;
  + &quot;}&quot;));
</code></pre>
<p>Here the &quot;keyUuid&quot; is the UUID of the datakey that was generated with ClientEncryption class's createDataKey() method. I had commented the @Encrypted annotation on MyDocument class temporarily in order to pass this hard coded SchemaMap.</p>
<p>Edit 2:</p>
<p>So we found that the issue was related to the schemaMap. The key name in the schemaMap was not matching with the document name.
The mongo document name was &quot;myDocument&quot; and what I put in the key of schemaMap was &quot;MyDocument&quot; with &quot;M&quot; in caps, thus it was not able to find the proper mapping and was failing.</p>

